import Bar from "../../components/bar";
import { Background } from "./styles";
const Home = () => {
  return (
    <>
      <Bar />

      <Background>
        <div className="container">
          <img src="../../images/background-home.png" alt="background" />
          <div className="name_page">
            <span>Monitore seus habitos</span>
          </div>
        </div>
      </Background>
    </>


  )
};

export default Home;
